import React from 'react';

const Header = () => {
  return (
    <header>
      <img src="https://via.placeholder.com/1920x200" alt="Header Image 1" />
      <img src="https://via.placeholder.com/1920x200" alt="Header Image 2" />
      <img src="https://via.placeholder.com/1920x200" alt="Header Image 3" />
    </header>
  );
}

export default Header;
